import React from 'react';
import HelloWorld from './HelloWorld';
import './App.css';
import Globe from 'react-globe.gl';

function App() {

  const [sqliteData,setSqliteData] = useState("");

  useEffect(() => {
    fetch("http://localhost:8000/sqlite")
      .then((res) => res.json())
      .then((data) => setSqliteData(data.sqliteData));
  }, []);

  return (
    <div className="App">
      <div>{sqliteData}</div>
      <HelloWorld />
    </div>
  );
}
export default App;
